var $bm_rt;
var path1, path2, r, s, s1, slider, t, x, r1, r2;
path1 = mask('Mask 1').maskPath;
path2 = mask('Mask 2').maskPath;
r = [];
s = [];
s1 = [];
slider = clamp(effect('frq')('Slider'), 0.1, 1);
t = $bm_sub(time, inPoint);
for (x = -1 + t / effect('time')('Slider') % slider; x <= 1; x = x + slider) {
    if (x >= 0) {
        r1 = path1.pointOnPath(x);
        r.push(r1);
        s.push([
            $bm_mul($bm_sub(path1.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[0], r1[0]), -1),
            $bm_mul($bm_sub(path1.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[1], r1[1]), -1)
        ]);
        s1.push([
            $bm_sub(path1.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[0], r1[0]),
            $bm_sub(path1.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[1], r1[1])
        ]);
    }
    ;
    if (x + slider / 2 <= 1 && x + slider / 2 >= 0) {
        r2 = path2.pointOnPath($bm_sum(x, $bm_div(slider, 2)));
        r.push(r2);
        s.push([
            $bm_sub(path2.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[0], r2[0]),
            $bm_sub(path2.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[1], r2[1])
        ]);
        s1.push([
            $bm_mul($bm_sub(path2.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[0], r2[0]), -1),
            $bm_mul($bm_sub(path2.pointOnPath($bm_sum(x, $bm_mul(slider, 0.25)))[1], r2[1]), -1)
        ]);
    }
    ;
}
;
$bm_rt = createPath(r, s, s1, false);

